:::{"id":"c31e943f-0757-4e42-8980-6008a2fc6bc8","title":{"en":"Brother Complex Onii-san, Kocchi Muite"},"altTitles":[{"ja-ro":"Brother Complex Onii-san Kocchi Muite"},{"en":"Please Look At Me: Brother Complex"},{"ja":"ブラコンお兄さん、こっち向いて"}],"lastChapter":"5","availableTranslatedLanguages":["en","es-la"],"description":{"en":"After his angelic brother’s birth 17 years ago, Haruhisa became an extreme brocon the moment he laid eyes on him. He poured all his love into his little brother in their busy parents’ stead, putting his own needs aside.  

On the day of his precious brother’s teacher-parent conference, Haruhisa marches in, ready to evaluate Mitsuhara’s worth as a homeroom teacher.  

A few days later, Haruhisa discovers that his brother has a lover! Moreover, it’s a male student from the same high school!? Turning to Mitsuhara to find out the truth, Haruhisa is suddenly kissed for some reason…?"},"links":{"al":"120402","amz":"https://www.amazon.co.jp/dp/4796412859/","cdj":"https://www.cdjapan.co.jp/product/NEOBK-2349728","ebj":"https://ebookjapan.yahoo.co.jp/books/541425/","kt":"58887","mu":"153725","raw":"https://www.cmoa.jp/title/172424/"},"originalLanguage":"ja","contentRating":"safe","tags":[{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"92d6d951-ca5e-429c-ac78-451071cbf064","name":{"en":"Office Workers"}}]}

:::{"id":"c3295871-b930-4ee3-ac0f-ff7102ecec4e","title":{"en":"Sasha-chan to Classmate Otaku-kun"},"altTitles":[{"ja":"サーシャちゃんとクラスメイトオタクくん"},{"en":"Sasha and Her Otaku Classmate"},{"fr":"Sasha et son camarade Otaku"}],"availableTranslatedLanguages":["es-la","fr","en"],"relatedIdds":["65d936d2-e401-4dc7-a5d6-ee9a4eaa3939","8a3b4527-71b1-44bc-b6da-9aae2b1df1a0"],"description":{"en":"I am an aspiring mangaka, currently assisting in the production of erotic doujinshi as a middle school student. While I was reading doujinshi at school, a beautiful girl very interested in erotic things, Sasha-san, suddenly called me "Master"!?

The story of a beautiful, cheerful girl volunteering to be my ecchi disciple.","fr":"Fujiwara est un mangaka amateur, il dessine des mangas érotiques alors qu’il n’est que collégien. Tandis qu'il lisait un porno à l'école, une jolie fille nommée Sasha qui s’avère être très intéressée par ces choses, et lui adresse la parole, elle se met même à l’appeler "Maître" !? 

  C’est l'histoire d'une belle et joyeuse fille qui se porte volontaire pour être mon disciple dans la perversion."},"links":{"al":"138818","amz":"https://www.amazon.co.jp/dp/B0B8SN7K63","ap":"sasha-chan-to-classmate-otaku-kun","bw":"series/361996","cdj":"https://www.cdjapan.co.jp/searchuni?fq.category=UD%3A14&q=%E3%82%B5%E3%83%BC%E3%82%B7%E3%83%A3%E3%81%A1%E3%82%83%E3%82%93%E3%81%A8%E3%82%AF%E3%83%A9%E3%82%B9%E3%83%A1%E3%82%A4%E3%83%88%E3%82%AA%E3%82%BF%E3%82%AF%E3%81%8F%E3%82%93&order=reldesc&opt.exclude_prx=on","ebj":"https://ebookjapan.yahoo.co.jp/books/706510/","kt":"sasha-chan-to-classmate-otaku-kun","mal":"147092","mu":"a7c7qo9","raw":"https://comic-walker.com/contents/detail/KDCW_AM07202859010000_68/"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"suggestive","tags":[{"id":"2d1f5d56-a1e5-4d0d-a961-2193588b08ec","name":{"en":"Loli"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"ddefd648-5140-4e5f-ba18-4eca4071d19b","name":{"en":"Shota"}},{"id":"e197df38-d0e7-43b5-9b09-2842d0c326dd","name":{"en":"Web Comic"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

:::{"id":"c32ff781-1df2-404b-8cd4-dcb5c643f090","title":{"en":"Kimochi no Yukue"},"altTitles":[{"en":"The Object of My Affection"},{"en":"キモチの行方"}],"availableTranslatedLanguages":["en"],"description":{"en":"All of Keiji's bodypiercings are the symbol of a secret contract, which stipulates that all his needs would be completely taken care of by two twin brothers, Sou and You, in exchange for his becoming their pet.  
However, the appearance of Miyama - Keiji's first actual friend - starts changing things. For the first time, Keiji finds it difficult to keep this dark secret buried, and the thin balance he tries to maintain unknowingly starts crumbling bit by bit…  

Feelings like growing fond of someone, trust, friendship, love… each swaying feeling is depicted in this famous series, now in completed version!"},"links":{"al":"47940","ap":"kimochi-no-yukue","kt":"5583","mal":"17940","mu":"6950"},"originalLanguage":"ja","contentRating":"erotica","tags":[{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}}]}

