After meeting Okabe Rintaro and the rest of the Lab Members, Kurisu reflects on her past with her estranged father and seeks to set things right with him, not knowing of the fate that awaits her.  

Part of [Steins;Gate](https://mangadex.com/?page=search&title=Steins%3BGate) series."},"links":{"al":"77825","ap":"steins-gate-aishin-meizu-no-babel","kt":"5268","mal":"47825","mu":"77896"},"originalLanguage":"ja","publicationDemographic":"seinen","contentRating":"safe","tags":[{"id":"3b60b75c-a2d7-4860-ab56-05f391bb889c","name":{"en":"Psychological"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}},{"id":"f8f62932-27da-4fe4-8ee1-6779a8c5edba","name":{"en":"Tragedy"}}]}

