:::{"id":"c37cb5b6-3245-4a06-840b-93f25bd760f8","title":{"en":"Be-bop High School"},"altTitles":[{"ja":"ビー・バップ・ハイスクール"},{"ja-ro":"Bī bappu haisukūru"}],"lastChapter":"308","availableTranslatedLanguages":["en"],"description":{"en":"The story revolves around the lives of two rough-and-tumble high school friends Kato Hiroshi and Nakama Toru, who seemed to make a habit of getting into trouble and starting up fights. In keeping with the spirit of the manga, Toru and Hiroshi sport slicked back 50's style ducktails and adopted exaggerated swaggers that made them comical and yet also oddly cool. The drama also features an assortment of outlandish characters who sport even weirder fashions and hairdos. To describe the action in this drama, think Fight Club meets The Breakfast Club.  

---
 - **Won the 12th Kodansha Manga Award for General Manga in 1988, which it shared with Bonobono**"},"links":{"al":"42094","amz":"https://www.amazon.co.jp/gp/product/B074CK2B1G","ap":"be-bop-highschool","bw":"series/4333/list","cdj":"https://www.cdjapan.co.jp/product/NEOBK-760873","ebj":"https://ebookjapan.yahoo.co.jp/books/518555/","kt":"22312","mal":"12094","mu":"32304"},"originalLanguage":"ja","publicationDemographic":"seinen","contentRating":"suggestive","tags":[{"id":"0a39b5a1-b235-4886-a747-1d05d216532d","name":{"en":"Award Winning"}},{"id":"3b60b75c-a2d7-4860-ab56-05f391bb889c","name":{"en":"Psychological"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"da2d50ca-3018-4cc0-ac7a-6b7d472a29ea","name":{"en":"Delinquents"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

:::{"id":"c38dac66-b994-4a66-9f38-0d01058440c3","title":{"en":"Corridor of Mirs"},"altTitles":[{"ko-ro":"Kami no Kairou"},{"en":"Mir's Cloister"},{"ja":"神の回廊"},{"ko":"미르의 회랑"},{"en":"Mire's Corridor"}],"lastChapter":"85","availableTranslatedLanguages":["en","pl"],"description":{"en":"One day, a girl woke up from a near car accident, and her name was Baek Nabi. After her chance encounter with a beautiful man, who saved her from the accident, Nabi starts to see things she has never seen before. Creatures who live off from human’s negative emotions are called ‘parasites’ . Nabi’s once normal life has overturned and becomes intertwined with several men all at the same time… “You’re a special existence. You just haven’t remembered yet.” A fantasy romance of Nabi and the mysterious beings around her.  


---

Official English translation by Comico's [Pocket Comics](https://www.pocketcomics.com/comic/208)"},"links":{"al":"111099","ap":"mires-corridor","engtl":"https://comikey.com/comics/corridor-of-mirs-webtoon/445/","mal":"152025","mu":"154205","raw":"http://page.kakao.com/link/52819244"},"originalLanguage":"ko","contentRating":"safe","tags":[{"id":"36fd93ea-e8b8-445e-b836-358f02b3d33d","name":{"en":"Monsters"}},{"id":"3e2b8dae-350e-4ab8-a8ce-016e844b9f0d","name":{"en":"Long Strip"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"65761a2a-415e-47f3-bef2-a9dababba7a6","name":{"en":"Reverse Harem"}},{"id":"a1f53773-c69a-4ce5-8cab-fffcd90b1565","name":{"en":"Magic"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"e197df38-d0e7-43b5-9b09-2842d0c326dd","name":{"en":"Web Comic"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}},{"id":"f5ba408b-0e7a-484d-8d49-4e9125ac96de","name":{"en":"Full Color"}}]}

