:::{"id":"c393864e-aefb-4162-9904-9cfa73fb06f0","title":{"en":"Thank You My God"},"lastChapter":"6.5","availableTranslatedLanguages":["en","ru"],"description":{"en":"Throwing away his hometown and family, Nico left home with empty hands. He then meets a young man in a foreign land, Eli.  

But he's suddenly faced with affection from his younger brother who came looking for him, Will, and the letters that keep coming from his mother…  

The various forms of love revolving around Nico are all here."},"links":{"al":"87429","ap":"thank-you-my-god","kt":"36800","mal":"93789","mu":"78368"},"originalLanguage":"ja","contentRating":"safe","tags":[{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

:::{"id":"c39fa657-db01-4ff3-819f-f3b923c95ce9","title":{"en":"Shinde Kara Honki Dasu"},"altTitles":[{"ja":"死んでから本気出す"},{"en":"I'll Get Serious After I Die"}],"lastChapter":"18","availableTranslatedLanguages":["en"],"description":{"en":"Takai Sena, a victim of relentless bullying at her high school, wishes she could die and reincarnate into another world. One morning, after pushing a neighborhood cat out of the way of an oncoming truck, she gets her wish, and wakes up as a ghost.

Accompanied by Familia, her so-called spirit guide, Sena is tasked with scaring the living and collecting the fear-essence they release when frightened. In doing so, she quickly discovers an extraordinary aptitude as a ghost, and finds a newfound sense of power and purpose in the afterlife.

Vowing to only scare those who she considers "evil," from abusive bosses to her own past abusers, Sena soon finds that confronting her own trauma may be the scariest thing of all."},"links":{"al":"134910","amz":"https://www.amazon.co.jp/dp/B09RMJFY4Q","bw":"de9a5af793-61b1-4a24-9411-318df0317012/","cdj":"https://www.cdjapan.co.jp/product/NEOBK-2605173","ebj":"https://ebookjapan.yahoo.co.jp/books/636960/","mal":"139853","mu":"184010","raw":"https://kuragebunch.com/episode/13933686331716337062"},"originalLanguage":"ja","contentRating":"safe","tags":[{"id":"0bc90acb-ccc1-44ca-a34a-b9f3a73259d0","name":{"en":"Reincarnation"}},{"id":"3b60b75c-a2d7-4860-ab56-05f391bb889c","name":{"en":"Psychological"}},{"id":"3bb26d85-09d5-4d2e-880c-c34b974339e9","name":{"en":"Ghosts"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"cdad7e68-1419-41dd-bdce-27753074a640","name":{"en":"Horror"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}}]}

:::{"id":"c3abd0e7-5f34-4027-bd99-2780cbecfe60","title":{"en":"Amatsu Kitsune to Fuuin no Uta"},"altTitles":[{"ja":"天つ狐と封印詩"},{"ja":"Amatsu Kitsune to Fuinnouta"},{"vi":"Thiên Hồ và Phong Ấn Thuật"},{"vi":"Thiên Hồ và Bài Thơ Phong Ấn"}],"lastChapter":"20.5","availableTranslatedLanguages":["vi"],"description":{"en":"Seiichi Takamagahara is a high school freshman living alone. One day, he finds a picture book among his grandmother's possessions. The monsters depicted there were not just pictures, but the monsters whose ancestors had sealed long ago. After a long time, the power of the seal weakens, and youkai are released to the world. The reincarnation Seiichi decides to seal the scattered monsters again with the fox god and silver. Mofumofu Youseki Kitan, woven by the gods.  


---","vi":"Takamagahara Seiichi hiện tại là một học sinh năm nhất cao trung, đang sống một mình. Một ngày nọ, trong khi đang sắp xếp lại đồ đạc mà bà mình để lại ,cậu đã tìm thấy một cuốn sổ có vẽ lại hình ảnh của những con yêu quái. Chúng không đơn thuần là những bức tranh bình thường, đó chính là hình ảnh của những con yêu quái mà tổ tiên xa xưa đã từng phong ấn trong quá khứ  
Nhiều năm tháng trôi qua, lớp phong ấn trở nên suy yếu, đám yêu quái được giải phóng ra ngoài thế giới. Tiếp tục nhiệm vụ của tổ tiên nhà Seiichi, cậu đã quyết tâm cùng với hai vị thần cáo bạc phong ấn lại đám yêu quái đang rải rác khắp nơi. Những câu chuyện bí ẩn về các vị thần và phong ấn yêu quái sẽ đan xen nhau xuất hiện."},"links":{"amz":"https://www.amazon.co.jp/-/en/寝子暇子-ebook/dp/B08252QZTF/ref=tmm_kin_swatch_0?_encoding=UTF8&qid=1603479753&sr=8-2","bw":"series/229856","mu":"160324"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"safe","tags":[{"id":"87cc87cd-a395-47af-b27a-93258283bbc6","name":{"en":"Adventure"}},{"id":"a1f53773-c69a-4ce5-8cab-fffcd90b1565","name":{"en":"Magic"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}}]}

:::{"id":"c3d90449-a868-489c-9675-64d36853fd06","title":{"en":"1SR6"},"description":{"en":"1SR6... is not the name of a special task force for counter-terrorism. 1SR6 is also not the name of the latest malignant computer virus. 1SR6 is just an ordinary class in an ordinary School of Fine Arts (SMSR) in Jogjakarta.

What makes it extraordinary are its inhabitants. The inhabitants of 1SR6 were high-class delinquents! So bad was this outcast class that the students of other classes nicknamed it 'hell class'. What happens when the sacred flag-raising ceremony is handed over to these delinquents?

(Source: Official synopsis, translated)"},"links":{"mu":"yvkj8rs"},"originalLanguage":"id","contentRating":"safe","tags":[{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

