(from ebookjapan):
The "International Incidents Division" was established in the Criminal Investigation Department of the Metropolitan Police Department on January 11, 1988. There are 47 members in the division, including 4 female investigators. These four team up to take on a difficult case involving a Japanese national abroad! ----The body of a dead Japanese man is found floating in Manila Bay. As the investigation progresses, the situation begins to resemble a murder with insurance money. In order to destroy the alibi of the perpetrator, the four head to Manila. ......? In addition to the title story, the collection also includes the slightly mysterious short story "Shotaro Manga Poems of the Heart"."},"links":{"raw":"https://manba.co.jp/boards/23669/books/1"},"originalLanguage":"ja","publicationDemographic":"seinen","contentRating":"suggestive","tags":[{"id":"07251805-a27e-4d59-b488-f0bfbec15168","name":{"en":"Thriller"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"5ca48985-9a9d-4bd8-be29-80dc0303db72","name":{"en":"Crime"}},{"id":"92d6d951-ca5e-429c-ac78-451071cbf064","name":{"en":"Office Workers"}},{"id":"b29d6a3d-1569-4e7a-8caf-7557bc92cd5d","name":{"en":"Gore"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"df33b754-73a3-4c54-80e6-1a74a8058539","name":{"en":"Police"}},{"id":"ee968100-4191-4968-93d3-f82d72be7e46","name":{"en":"Mystery"}}]}

:::{"id":"c3eadc89-e828-43c9-95f8-af86f074ce0a","title":{"en":"Sudden Unintended Romance"},"altTitles":[{"ko":"급발진 로맨스"}],"availableTranslatedLanguages":["en"],"description":{"en":"Ever wanted to hear someone’s thoughts?

