:::{"id":"c4af0ad6-a3db-4f8d-8810-ea319a17a400","title":{"en":"Bokura wa Minna Kawaisou"},"altTitles":[{"en":"We Are All a Part of the Kawai Complex!"},{"it":"poveri noi! - Tutti a casa Kawai"},{"pt":"Somos Todos Parte do Complexo Kawai"},{"en":"The Kawai Complex Guide to Manors and Hostel"},{"ja-ro":"Bokura wa Minna Kawai-sou"},{"ru":"Все мы живем в общежитии Кавай"},{"ja":"僕らはみんな河合荘"},{"zh":"我们大家的河合庄"}],"lastChapter":"3","availableTranslatedLanguages":["it","pt-br","ru","en","id","tr","pl","fr"],"description":{"en":"Kazunari Usa's dream to live away from his parents is fulfilled when they allow him to move into an old boarding house called Kawai Complex. With his landlady providing him meals and his parents covering his rent, Kazunari finally achieves the peaceful life he longs for, as he is ready to enter his first year at high school. Or so it seems…  

Upon moving into the boarding house, Kazunari finds out that he has to share a room with resident masochist Shirosaki. He must also live under the same roof as Mayumi Nishikino, a drunkard with a hopeless love life, and Sayaka Watanabe, a seemingly innocent college student. Although he is surrounded by these unique characters, Kazunari still counts himself lucky to be living in the same building as Ritsu Kawai, a second-year student he has a crush on.  

As Kazunari settles into the boarding house, he soon realizes that the inhabitants of Kawai Complex are bound to add a twist to the life he has been hoping to live.","ru":"Главный герой Уса только-только окончил ненавистную среднюю школу, как решил начать жизнь с чистого листа, да так, чтоб каждый день его был наполнен спокойствием и уютом. Первым шагом на пути к этой цели стало переселение в общежитие. Но как быть, если вдруг обнаруживается, что твой сосед - прямое напоминание о позорном школьном периоде, к тому же заядлый извращуга, а соседка - не кто иная, как любовь с первого взгляда, которой он еще в средней школе никак не решался признаться?"},"links":{"al":"56769","amz":"https://www.amazon.co.jp/gp/product/B074CN1TGN/","ap":"the-kawai-complex-guide-to-manors-and-hostel-behavior","bw":"series/7445/list","cdj":"http://www.cdjapan.co.jp/product/NEOBK-946831","ebj":"https://ebookjapan.yahoo.co.jp/books/234628/","engtl":"http://www.crunchyroll.com/comics/manga/bokura-wa-minna-kawaisou/volumes","kt":"20286","mal":"26769","mu":"53051","raw":"http://manga-zip.net/archives/210725.html"},"originalLanguage":"ja","publicationDemographic":"seinen","contentRating":"safe","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

