Note: The title was never "- sensei," the Japanese characters "ティーチャー" phonetically spell "teacher"","es":"Onegai Teacher es una serie de anime japonesa, escrita por Yousuke Kuroda y producida por el estudio Bandai, la cual fue posteriormente adaptada a una versión manga. La historia se basa en un grupo de amigos y unos hechos misteriosos y extraños que ocurren tras la llegada de una nueva profesora a su colegio.","pt-br":"Deprimido um dia, Kei está a beira do lago de sua cidade. Repentinamente algo acontece, a água do lago vira um turbilhão como se algo estivesse sobrevoando a água, e então, do nada, diante dele, uma mulher aparece como em um teletransporte. Kei tenta fugir, e a última coisa que ele lembra antes de cair no lago é a mulher correndo atrás dele com uma aura amarelada — **uma alienígena?**

No dia seguinte, na escola, os alunos recebem notícias interessantes: Eles terão uma nova professora — uma linda mulher. Eis que a mulher é nada menos que aquela que Kei viu no lago - o que isto quer dizer?"},"links":{"al":"30874","ap":"onegai-teacher","engtl":"http://web.archive.org/web/20050205091606/http://www.comicsone.com/onegaiTeacher/","kt":"1902","mal":"874","mu":"3171"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"suggestive","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"f4122d1c-3b44-44d0-9936-ff7502c39ad3","name":{"en":"Adaptation"}}]}

